function TabCreate(){
    return(

        <div className="px-20">


            <div className="flex items-center justify-center min-h-screen">

                <form action="">
                    <div>
                        <label htmlFor="">Titolo</label>
                        <input type="text" />
                    </div>
                </form>

            </div>

        </div>

    );
}

export default TabCreate;
